double FisherCriteria::GetFisherVal(int minF, int maxF)
{
    assert(maxF > 0);
    assert(minF > 0);

    if((maxF < 1) || (minF < 1)) return 0;

    if(maxF > 50) maxF = 50;

    if(minF > 50) minF = 50;

    FisherCriteria::init();
    return FisherCriteria::fisherTable[(maxF - 1) * 50 + minF - 1];
}

vector<double> FisherCriteria::SupportedProbs()
{
    vector<double> vec;
    vec.push_back(0.05);
    return vec;
}
